    #[doc = "        that is, start_addr_chn = RMT base address + 0x800 + 64 ∗ 4 ∗ n, and"]
    #[doc = "        end_addr_chn = RMT base address + 0x800 +  64 ∗ 4 ∗ n + 64 ∗ 4 ∗ RMT_MEM_SIZE_CHn mod 512 ∗ 4"]
